style.css:
@-moz-document domain("time.is") {
body {
    background: #212529;
    color: #fff;
}

#mainwrapper {
    background: #212529;
}

.inputframe {
    background: #2b3035;
    border: 1px solid #495057;
    border-radius: 0.375rem;
}

.inputframe input {
    background: #6c757d;
}

.mout, div .hovered {
    border-color: #7b7b7b;
    color: #fff;
}

label {
    color: #fff;
}

a:link, a:visited {
    color: #fff;
    text-decoration: none;
    border-bottom: 1px solid #ccc;
}

#favs li a {
    background-color: #1b1f22;
}

.mt #favs li span {
    color: #fff;
}
}
